import React, { Component } from 'react';

import img1 from './frank1.jpg';
import img2 from './frank2.png';
import img3 from './frank3.jpg';
import img4 from './frank4.jpg';

export default class About extends Component {
    render() {
        return(
         <div >
             <img src={img1} className="img" width="300" height="250"/>
             <img src={img2} className="img" width="350" height="300"/>
             <img src={img3} className="img" width="350" height="200"/>
             <img src={img4} className="img" width="290" height="290"/>

            </div>
        )
    }
    
}

//export default About;
